import "./App.css";
import { Route, Routes, BrowserRouter } from 'react-router-dom'
import ManageCourses from './screens/ManageCourses'
import ManageInstructors from './screens/ManageInstructors'


function App() {
  return (
    <div className='container-fluid'>
      <BrowserRouter>
        <Routes>



          <Route path='/course' element={<ManageCourses />} />
          <Route path='/instructor' element={<ManageInstructors />} />
          <Route path='/instructor' element={<ManageInstructors />} />




        </Routes>
      </BrowserRouter>

    </div>






  )
}

export default App;
